import React from 'react';
import { NavLink } from 'react-router-dom';



const Order = () => {
    const [orderData, setOrderData] = useState({});
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        // Use the URL of your JSON data
        fetch('http://localhost:3000/checkoutDetails')
            .then((response) => response.json())
            .then((data) => {
                console.log(data);
                setOrderData(data[1]);
                setLoading(false);
            })
            .catch((error) => {
                console.error('Error fetching data: ', error);
                setLoading(false);
            });
    }, []); // The empty array means this effect runs once when the component mounts

    if (loading) {
        return <div>Loading...</div>;
    }

    
    const order= (rest) => {
        console.log(rest, 'gggggggggg')
        return(
            <>
                
                <div className="px-4 my-5 bg-light rounded-3 py-5">
                <div className="container py-4">
                    <div className="row justify-content-center">
                        <div className="col-md-4">
                            <img src={rest.url} alt={rest.foodName} height="200px" width="180px" />
                        </div>
                        <div className="col-md-4">
                            <h3>{rest.foodName}</h3>
                            <p className="lead fw-bold">
                                {rest.qty} X ${rest.price} = ${rest.qty * rest.price}
                            </p>
                            <button className="btn btn-outline-dark me-4" onClick={()=>handleDel(rest)}>
                                <i className="fa fa-minus"></i>
                            </button>
                            <button className="btn btn-outline-dark" onClick={()=> handleAdd(rest)}>
                                <i className="fa fa-plus"></i>
                            </button>
                        
                        </div>
                    </div>
                </div>
            </div>
            
            </>
            
        )

    }
    const buttons = () => {
        return(
            <>
                <div className="container">
                    <div className="row">
                        <NavLink to="/checkout" className="btn btn-outline-dark mb-5 w-25 mx-auto">
                            Proceed to Checkout
                        </NavLink>
                    </div>
                </div>
            </>
        )
    }

    
}

export default order;
